import React from 'react';

const charComponent = ( props ) => {
    const style = {
        display: "inline-block",
        padding: "16px",
        margin: "16px",
        textAlign: "center",
        border: "1px solid #333"

    };

    return (
        <div style={style}>{ props.letter }</div>
    );
};

export default charComponent;
